'use strict';

/**
* Image of a French alpine landscape.
*
* @module @stdlib/datasets/img-french-alpine-landscape
*
* @example
* var image = require( '@stdlib/datasets/img-french-alpine-landscape' );
* var img = image();
* // returns <Buffer>
*/

// MODULES //

var IS_BROWSER = require( '@stdlib/assert/is-browser' );


// MAIN //

var image;
if ( IS_BROWSER ) {
	image = require( './browser.js' );
} else {
	image = require( './french_alpine_landscape.js' );
}


// EXPORTS //

module.exports = image;

